function startCountdown(n){let i=n,t=getTime(i);t.day<1&&countdownDay.classList.add("d-none");t.hour<1&&countdownHour.classList.add("d-none");let r=setInterval(function(){t=getTime(--i);setValue(t);i<0&&(clearInterval(r),window.location.href="/")},1e3)}function getTime(n){let t=n/86400;n=n%86400;let i=n/3600;n%=3600;let r=n/60;return n%=60,{day:Math.floor(t),hour:Math.floor(i),minute:Math.floor(r),second:Math.floor(n)}}function setValue(n){countdownDay.innerText=n.day.toTwoDigitFormat();countdownHour.innerText=n.hour.toTwoDigitFormat();countdownMinute.innerText=n.minute.toTwoDigitFormat();countdownSecond.innerText=n.second.toTwoDigitFormat()}let countdown,countdownDay,countdownHour,countdownMinute,countdownSecond;(function(){countdown=document.getElementById("countdown");countdownDay=document.getElementById("days");countdownHour=document.getElementById("hours");countdownMinute=document.getElementById("minutes");countdownSecond=document.getElementById("seconds");startCountdown(countdown.dataset.value)})();